import React,{Component} from "react";
import FruitContext from "./FruitContext";
class Seed extends Component{
    static contextType=FruitContext;

    render(){
        return(
            <p> Seed Info:{this.props.name}
            I am:{this.context}</p>
        )
    }
}
export default Seed;
